__NUXT_JSONP__("/gallery/octobers-child", (function(a,b){return {data:[{document:{date:a,title:[{type:"heading3",text:"October's Child",spans:[]}],photo:{dimensions:{width:1200,height:800},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002F1b725f2b-7b95-421e-9bfa-2b4f445b332b_Octobers-Child.jpg?auto=compress,format&rect=0,0,1599,1066&w=1200&h=800",small:{dimensions:{width:320,height:213},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002F1b725f2b-7b95-421e-9bfa-2b4f445b332b_Octobers-Child.jpg?auto=compress,format&rect=0,0,1600,1065&w=320&h=213"}},content:[{type:b,text:"O is for October’s child…\nBorn for woe,\nAnd life’s vicissitudes must know,\nBut lay an opal on her breast,\nAnd hope will lull those woes to rest.",spans:[]},{type:b,text:"- from the Gregorian calendar of birthstones",spans:[{start:0,end:44,type:"em"}]},{type:b,text:"The  faces (there are about 60) are from various photos, mostly of my  daughter, born in my favorite month of October. They were blended in  with layer blend effects in Photoshop so that the textures of the leaves  look like they’re following the contours of the faces. Basic picture is  a forest floor in autumn.\nForet de Soignes, near Brussels, Belgium.",spans:[]},{type:b,text:"All  portraits and background shot on film with Canon EOS 100 + various  lenses, scanned to digital on a Canon FS 2710 film scanner.",spans:[]}],tag:"montage"}}],fetch:[],mutations:void 0}}(null,"paragraph")));